import React from "react";
import UseAnimations from 'react-useanimations';

const openInNewTab = (url) => {
    const newWindow = window.open(url, '_blank', 'noopener,noreferrer');
    if (newWindow) newWindow.opener = null;
}

const SocialMedia = () => {

    return (
        <div className="social-network">
            <UseAnimations className="social-media-item" animationKey="github" loop={true} style={{width:"34px"}} /> 
            <a href="https://stackoverflow.com/questions/71506190/how-can-i-link-to-another-website-in-react"></a>   
            <UseAnimations className="social-media-item" animationKey="linkedin" loop={true} style={{width:"34px"}} />    
            <UseAnimations className="social-media-item" animationKey="facebook" loop={true} style={{width:"34px"}} />    
            <UseAnimations className="social-media-item" animationKey="download" style={{width:"34px"}} />    

        </div>
    );
} 

export default SocialMedia;
